import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  appBar: {
    borderRadius: 15,
    margin: '30px 0',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
  },
  heading: {
    color: 'rgba(103, 194, 73)',
  },
  image: {
    height: '60px',
    width: '60px',
    marginLeft: '15px',
  },
  [theme.breakponts.down('sm')]:{

  }
}));
